export default function ManageCourses({ courses }) {
  return (
    <div>
      <h3>Courses List</h3>
      {courses.length === 0 ? (
        <p>No courses available.</p>
      ) : (
        <ul>
          {courses.map((course) => (
            <li key={course.id || course.courseId || course.name}>{course.name}</li>
          ))}
        </ul>
      )}
    </div>
  );
}
